 loveable relationship with all the members joining us . We also have so many exicting features and alot of things gonna explore with several versions update . Requesting all users to stay updated with us to know more about swftea and enjoy all the upcoming features that will be included with each updated version of app . Various programme like : merchantship , mentorship , headmentorship , global admins etc will be launched soon  . We have  categorized users on several category  like : global admins , head mentors , mentors , merchants , legends and seniors where there will be staff section for community management team . We will select the category of users on the basis of their activities following on rules and regulations of the community . Each user play a vital role to inlarge the community so , we value each user in our community . we have a group of followup for each of the difficulties solution finding for users reliability and smoothness . Various games are added in the app which can be played in all types of chatrooms . Games like guess bot , lowcard bot are well known and user demanding games so we wis<font face=\\\"Comic Sans MS\\\" style=\\\"background-color: rgb(214, 214, 231);\\\"><span style=\\\"font-family: &quot;Times New Roman&quot;;\\\">h a luck and happy timing to all gamers joining us .&nbsp;<\\/span><\\/font><span style=\\\"font-family: &quot;Times New Roman&quot;;\\\">\\ufeff<\\/span><\\/p>\",\"_token\":\"Eu4BpG3fDN5U9K8e8ys40T8YAMXmSb59Pkfymttm\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/swftea.com\\/admin\\/announcements\"}','2020-06-15 12:01:38','2020-06-15 12:01:38'),(4182,2,'admin/announcements','GET','162.158.166.253','[]','2020-06-15 12:01:39','2020-06-15 12:01:39'),(4183,2,'admin/announcements/1/edit','GET','162.158.166.253','{\"_pjax\":\"#pjax-container\"}','2020-06-15 12:01:44','2020-06-15 12:01:44'),(4184,2,'admin/announcements/1','PUT','162.158.166.253','{\"title\":\"welcome and brefying\",\"abstract\":\"warm welcome to all