INSERT INTO `announcements` VALUES (1,'welcome and brefying','warm welcome to all our members .',1,'public/images/31e8a2917cb78fe59534810380538526.jpg','<h5 style=\"text-align: justify;\">\r\n<span style=\"color: inherit; background-color: rgb(255, 231, 206);\"><span style=\"font-family: &quot;Courier New&quot;;\">We heartly welcome all our members joining us together to make the swftea community inlarge all over . In this starting and developing phase of our family we hereby announce to provide rewards to specific users on the basis of their activities here . Swftea is not just a app or chatting platform but its also a dream to stand together establishing brotherhood and loveable relationship with all the members joining us . We also have so many exicting features and alot of things gonna explore with several versions update . Requesting all users to stay updated with us to know more about swftea and enjoy all the upcoming features that will be included with each updated version of app . Various programme like : merchantship , mentorship , headmentorship , global admins etc will be launched soon  . We have  categorized users on several category  like : global admins , head mentors , mentors , merchants , legends and seniors where there will be staff section for community management team . We will select the category of users on the basis of their activities following on rules and regulations of the community . Each user play a vital role to inlarge the community so , we value each user in our community . we have a group of followup for each of the difficulties solution finding for users reliability and smoothness . Various games are added in the app which can be played in all types of chatrooms . Games like guess bot , lowcard bot are well known and user demanding games so we wis</span><font face=\"Comic Sans MS\">h a luck and happy timing to all gamers joining us .&nbsp;</font></span><span style=\"color: inherit; background-color: rgb(156, 0, 255); font-family: &quot;Comic Sans MS&quot;;\">﻿</span><br>\r\n</h5>','2020-06-13 06:28:33','2020-06-15 12:08:33');
