40822.1592330930153\"\r\nX-Binding: bg-abd-346\r\nX-MarketoID: 937-EID-756:0:5964:24785:0:7698:9:21014:40318443-1\r\nX-Mailfrom: 937-EID-756.0.21014.0.0.7698.9.40318443-1@info.digitalocean.com\r\nList-Unsubscribe: <mailto:MFBGIV3OMJDXM52RNVKDCZCTJ5XEQ3LNHBJGIUDTM5AW6R2FNB2XSTBUJUYECYKQKJTVCPI=.21014.7698.9@unsub-ab.mktomail.com>\r\nX-MktArchive: false\r\nX-MSYS-API: {\"options\":{\"open_tracking\":false,\"click_tracking\":false}}\r\nX-MktMailDKIM: true\r\n\r\n------=_Part_10273926_1689740822.1592330930153\r\nContent-Type: text/plain; charset=UTF-8\r\nContent-Transfer-Encoding: quoted-printable\r\n\r\nBest practices for setting up your new Ubuntu server\r\nCongratulations on spinning up your first Ubuntu Droplet! We want to help y=\r\nou make the most of your Droplet and have come up with a list of recommende=\r\nd next steps to help you get set up quickly and easily.=20\r\n\r\nSTEP ONE: THE MUST-HAVES\r\n\r\n\r\n\r\n=09- Review the Ubuntu 18.04 server checklist which covers:\r\n\r\n\r\n\r\n=09- Initial Ubuntu server setup <https://pages.news.digitalocean.com/v2JF0=\r\nXEM0V6DEtMjI03a000> tutorial with step-by-step configuration instructions, =\r\nand\r\n=09- Connecting to your Droplet with SSH <https://pages.news.digitalocean.c=\r\nom/x0E0000E3Nj26XI0NVJtFDa>.\r\n\r\n\r\n=09- Use DigitalOcean=E2=80=99s DNS to set up your hostname <https://pages.=\r\nnews.digitalocean.com/jaOI0j36E20JF0tXDVO0E00> from the Control Panel.\r\n\r\n=09- Protect your servers by reviewing these 7 security measures <https://p=\r\nages.news.digitalocean.com/TPXEE0t0j000FIP326JaVD0>.\r\n\r\n=09- Filter unwanted traffic by using Cloud Firewalls <https://www.digitalo=\r\ncean.com/docs/networking/firewalls/?utm_source=3Dlocal&utm_medium=3DEmail_I=\r\nnternal&utm_campaign=3DEmail_UbuntuDistroNginxWelcome>.\r\n=09- Keep your=C2=A0server image safe=C2=A0using the=C2=A0backups feature <=\r\nhttps://pages.news.digitalocean.com/ZIXJt0jQV0002a0FQ306DEE>.\r\n\r\n\r\n\r\n\r\nSTEP TWO: WEB SERVERS\r\n\r\n\r\n\r\n=09- Install the powerful Nginx web server <https://pages.news.digitalocean=\r\n.com/jaRI0j36E20JF0tXDVR0E00> on Ubuntu*.\r\n\r\n=09- Use Nginx virtual hosts <https://www.digitalocean.com/community/tutori=\r\nals/how-to-install-nginx-on-ubuntu-18-04?utm_source=3Dlocal&utm_medium=3DEm=\r\nail_Internal&utm_campaign=3DEmail_UbuntuDistroNginxWelcome#step-5-%E2%80%93=\r\n-setting-up-server-blocks-(recommended)> to serve multiple sites on one ser=\r\nver.=C2=A0\r\n\r\n\r\n\r\n\r\n* Want to use Apache as your web server instead? Follow the Apache web serv=\r\ner <https://www.digitalocean.com/community/tutorials/how-to-install-the-apa=\r\nche-web-server-on-ubuntu-18-04?utm_source=3Dlocal&utm_medium=3DEmail_Intern=\r\nal&utm_campaign=3DEmail_UbuntuDistroNginxWelcome> and Apache virtual hosts =\r\ntutorials to get it set up on Ubuntu.\r\n\r\nEXTRA CREDIT: SECURE FILE TRANSFER\r\n\r\n\r\n\r\n=09- Securely transfer files to your server and between droplets using SFTP=\r\n <https://pages.news.digitalocean.com/JI36Ea0SjD0XSEF0Vt002J0>.\r\n\r\n\r\n\r\n\r\nLooking to do something more? Head over to our Community <https://pages.new=\r\ns.digitalocean.com/K00aJEI206ET3TVFt0jX0D0> site at any time to access our =\r\ngrowing library of Ubuntu tutorials!=20\r\n\r\nHappy Coding,=20\r\nThe=C2=A0DigitalOcean Team\r\n<http://do.co/email_twitter> <http://do.co/email_facebook> <https://www.ins=\r\ntagram.com/thedigitalocean/> <https://www.youtube.com/channel/UCaPX53JLxxSb=\r\nwZz_Ra_cL0g> <https://www.linkedin.com/company/digitalocean/>Refer=C2=A0a=\r\n=C2=A0Friend <https://cloud.digitalocean.com/settings/referrals/>\r\nTrouble seeing this email?=C2=A0View it as a web page. <https://go.digitalo=\r\ncean.com/index.php/email/emailWebview?mkt_tok=3DeyJpIjoiT1RsalptTXdZemN6Wm1=\r\nFeCIsInQiOiJJSHpnbEZPdSszUlA1ejlMM2ltMS80M1pMUjdObE5kc3NGaFoxVUFNMWZrN25MOG=\r\n1wcjk2aElZdEZzNDlPbENaWEdyM21MY3FOZWswYys1Y0c3UXRzUHBYeDhMMWtXZkQ1ZnE2bzZNc=\r\nXA5K0pzS3F4SHVYcGk2SVNZRWFZVUlRTCJ9&aliId=3Dj0xSc8PG