=\r\nbsp;</td>=20\r\n</tr>\r\n<!-- Start Spacer -->=20\r\n<tr>=20\r\n<td class=3D\"w31\" width=3D\"41\" style=3D\"font-size:1px; line-height:1px;\">&n=\r\nbsp;</td>=20\r\n<td height=3D\"50\" style=3D\"font-size:1px; line-height:1px;\">&nbsp;</td>=20\r\n<td class=3D\"w31\" width=3D\"41\" style=3D\"font-size:1px; line-height:1px;\">&n=\r\nbsp;</td>=20\r\n</tr>=20\r\n<!-- End Spacer -->\r\n</tbody>\r\n</table></td>\r\n</tr>\r\n<!-- End of Main Title-->=20\r\n<!-- *************************** -->\r\n<!-- Start of Main Content -->=20\r\n<tr style=3D\"\">\r\n<td bgcolor=3D\"#FFFFFF\" align=3D\"center\" style=3D\"\">\r\n<table width=3D\"100%\" align=3D\"center\" cellpadding=3D\"0\" cellspacing=3D\"0\" =\r\nborder=3D\"0\" class=3D\"devicewidth\" style=3D\"\">\r\n<tbody style=3D\"\">\r\n<!-- Start Spacer -->=20\r\n<tr>=20\r\n<td class=3D\"w22\" width=3D\"41\" style=3D\"font-size:1px; line-height:1px;\">&n=\r\nbsp;</td>=20\r\n<td class=3D\"h26\" height=3D\"36\" style=3D\"font-size:1px; line-height:1px;\">&=\r\nnbsp;</td>=20\r\n<td class=3D\"w22\" width=3D\"41\" style=3D\"font-size:1px; line-height:1px;\">&n=\r\nbsp;</td>=20\r\n</tr>=20\r\n<!-- End Spacer -->\r\n<tr style=3D\"\">\r\n<td class=3D\"w22\" width=3D\"41\" style=3D\"font-size:1px; line-height:1px;\">&n=\r\nbsp;</td>=20\r\n<td class=3D\"mktEditable content\" id=3D\"edit_text_1\" style=3D\"font-family:\'=\r\nProxima Nova\', Calibri, Helvetica, sans-serif; font-size:16px; color:#50505=\r\n0; text-align:left; line-height:25.6px; font-weight:normal; text-transform:=\r\nnone; \"><p>Congratulations on spinning up your first Ubuntu Droplet! We wan=\r\nt to help you make the most of your Droplet and have come up with a list of=\r\n recommended next steps to help you get set up quickly and easily. <br><br>=\r\n<strong>STEP ONE: THE MUST-HAVES</strong><br></p>=20\r\n<ul>=20\r\n<li><span style=3D\"line-height: 25.6px;\">Review the Ubuntu 18.04 server che=\r\ncklist which covers:</span><br></li>=20\r\n<ul>=20\r\n<li><span style=3D\"line-height: 25.6px;\"><a href=3D\r\n\"https://pages.news.digitalocean.com/Uaut0JD06I0EVE03jX020uF\" target=3D\"_bl=\r\nank\"\r\n>Initial Ubuntu server setup</a> tutorial with step-by-step configuration i=\r\nnstructions, and</span></li>=20\r\n<li><span style=3D\"line-height: 25.6px;\"><a href=3D\r\n\"https://pages.news.digitalocean.com/I0j2vEF06JtvXV3a0E0ID00\" target=3D\"_bl=\r\nank\"\r\n>Connecting to your Droplet with SSH</a>.</span></li>=20\r\n</ul>=20\r\n<li><span style=3D\"line-height: 25.6px;\">Use DigitalOcean=E2=80=99s DNS to =\r\n<a href=3D\r\n\"https://pages.news.digitalocean.com/FjFI600ww0E2t3Ea000DVXJ\" target=3D\"_bl=\r\nank\"\r\n>set up your hostname</a> from the Control Panel.</span><br></li>=20\r\n<li><span style=3D\"line-height: 25.6px;\">Protect your servers by reviewing =\r\nthese <a href=3D\r\n\"https://pages.news.digitalocean.com/o03xX00xE00jtE0JFDIVa62\" target=3D\"_bl=\r\nank\"\r\n>7 security measures</a>.</span><br></li>=20\r\n<li><span style=3D\"line-height: 25.6px;\">Filter unwanted traffic by <a href=\r\n=3D\r\n\"https://pages.news.digitalocean.com/n/uyX200FIJ60V0y03EtaEDj0\" target=3D\"_=\r\nblank\" class=3D\"mktNoTok\" id=3D\"\"\r\n>using Cloud Firewalls</a>.</span></li>=20\r\n<li><span style=3D\"line-height: 25.6px;\">Keep your&nbsp;server image safe&n=\r\nbsp;using the&nbsp;<a href=3D\r\n\"https://pages.news.digitalocean.com/o03zX00zE00jtE0JFDIVa62\" target=3D\"_bl=\r\nank\" id=3D\"\"\r\n>backups feature</a>.</span><br></li>=20\r\n</ul> <p><strong>STEP TWO: WEB SERVERS</strong><br></p>=20\r\n<ul>=20\r\n<li><span style=3D\"line-height: 25.6px;\">Install the powerful <a href=3D\r\n\"https://pages.news.digitalocean.com/LaJ3DI00j0AE2EAFt060V0X\" target=3D\"_bl=\r\nank\"\r\n>Nginx web server</a> on Ubuntu*.</span><br></li>=20\r\n<li><span style=3D\"line-height: 25.6px;\">Use <a href=3D\r\n\"https://pages.news.digitalocean.com/n/tVDt3a2EEF06B00XIJ000jB\" target=3D\"_=\r\nblank\" class=3D\"mktNoTok\"\r\n>Nginx virtual hosts</a> to serve multiple sites on one server.&nbsp;</span=\r\n><br></li>=20\r\n</ul> <p><span style=3D\"font-size: 12px;\">* Want to use Apache as your web =\r\nserver instead? Follow the <a href=3D\r\n\"https://pages.news.digitalocean.com/n/K00aJEI206EC3CVFt0jX0D0\" target=3D\"_=\r\nblank\" class=3D\"mktNoTok\"\r\n>Apache web server</a> and Apache virtual hosts tutorials to get it set up =\r\non Ubuntu.</span><br><br><strong>EXTRA CREDIT: SECURE FILE TRANSFER</strong=\r\n><br></p>=20\r\n<ul>=20\r\n<li><span style=3D\"line-height: 25.6px;\">Securely transfer files to your se=\r\nrver and between droplets <a href=3D\r\n\"https://pages.news.digitalocean.com/ZIXJt0jDV0002a0FD306DEE\" target=3D\"_bl=\r\nank\"\r\n>using SFTP</a>.</span><br></li>=20\r\n</ul> <p>Looking to do something more? Head over to our <a href=3D\r\n\"https://pages.news.digitalocean.com/s0EE26j0FIXE0E0aJt30V0D\" target=3D\"_bl=\r\nank\"\r\n>Community</a> site at any time to access our growing library of Ubuntu tut=\r\norials! <br><br>Happy Coding, <br>The&nbsp;DigitalOcean Team</p></td>\r\n<td class=3D\"w22\" width=3D\"41\" style=3D\"font-size:1px; line-height:1px;\">&n=\r\nbsp;</td>=20\r\n</tr>\r\n<!-- Start Spacer -->=20\r\n<tr>=20\r\n<td class=3D\"w22\" width=3D\"41\" style=3D\"font-size:1px; line-height:1px;\">&n=\r\nbsp;</td>=20\r\n<td class=3D\"h20\" height=3D\"41\" style=3D\"font-size:1px; line-height:1px;\">&=\r\nnbsp;</td>=20\r\n<td class=3D\"w22\" width=3D\"41\" style=3D\"font-size:1px; line-height:1px;\">&n=\r\nbsp;</td>=20\r\n</tr>=20\r\n<!-- End Spacer -->\r\n</tbody>\r\n</table></td>\r\n</tr>\r\n<!-- End of Main Content -->=20\r\n<!-- *************************** -->\r\n<!-- Start of Footer -->=20\r\n<tr style=3D\"\">=20\r\n<td bgcolor=3D\"#F7F7F7\" align=3D\"center\" style=3D\"\">=20\r\n<table width=3D\"100%\" cellpadding=3D\"0\" cellspacing=3D\"0\" border=3D\"0\" alig=\r\nn=3D\"center\" class=3D\"devicewidth\" style=3D\"\">=20\r\n<tbody>\r\n<tr style=3D\"\">=20\r\n<td class=3D\"mktEditable footer\" id