एको बेला प्रियाको फोन आयो ।\r\nमैले के छ ! कसो छ ? भनि हालखबर सोँधे । सबै राम्रै\r\nरहेको जानकारी गराईन । उनका भाई र\r\nबहिनी कामको सिलसिलामा गाउँ गएको बताई ।\r\nअनि मैले सोँधे “एक्लै बस्नु डर लाग्दैन ?” उनले “लाग्दैन”\r\nभन्ने छोटो जवाफ दिई । उनले\r\n“मेरो मोवाईलको व्यालेन्स सकियो , यता १००\r\nको रिचार्ज कार्ड नै पाईन , सक्नु हुन्छ भने ल्याईदिनु\r\nहोस न !” भनि । मैले पनि “अफिसको काम सकेर लिएर\r\nआउँला” भनि जवाफ दिए । करिव ३ बजे तिर सबै काम\r\nसकिओरी म मोटरसाईकल लिएर निस्के । वाटोमा १००\r\nको रिचार्ज कार्ड र २ प्याकेट चिप्स किनेर म\r\nप्रियाको डेरा तिर लागे । गेटमा मोटरसाईकल रोकेर\r\nउनलाई मिस कल गरे , उनि ढोका खोल्न आई । भर्खर\r\nनुहाएर बसेकी रहिछन , कपाल चिसै र खुल्लै थियो ।\r\nम सरासर उसको पछि पछि कोठा तिर लागे र\r\nचिप्सको झोला र रिचार्ज कार्ड उनलाई दिए । “बस्दै\r\nगर्नुहोस है , म चिया पकाएर ल्याउँछु ” भन्दै\r\nउनि किचन तिर लागि । एक छिन कोठामै बसे र पिसाब\r\nफेर्न भनि म ट्वाईलेट तिर छिरे । पिसाब फेर्दै\r\nचारैतिर हेरे , उनले भर्खर खोलेर\r\nसुकाएको हरियो पेन्टी देखे । खोई मलाई के भयो भयो ,\r\nउनको पेन्टी हातमा लिएर सुँघ्न थाले ।\r\nकस्तो बासना आयो आयो मेरो लाडो त ठनक्क भएर\r\nआयो । मलाई खपि नसक्नु भयो र मैले त्यँही छोलिदिए\r\n( हस्ते हाने )। त्यसपछि म बाहिर निस्के र किचन तिर\r\nछिरे । उनी चिया गिलासमा राख्दै थिई । म\r\nउनको छेउमा बसेर हेरि रहेको थिए । “के हेर्नु भएको ?”\r\nभन्दै मलाइ उनको कण्डोले धक्का दिई । मैले\r\nपनि “केहि होईन , चिया कसरी बनाउछ भनेर\r\nहेरेको नि” भन्दै उनीलाई मेरो कण्डोले धक्का दिए ।\r\n“जाऊँ कोठामै बसेर चिया खाउँ” भनि र म\r\nपछि पछि कोठा तिर लागे । कोठामा बसेर टी. भी.\r\nहेर्दै चिया खान थाल्यौ । म बढी SPORTS CHANNEL\r\nहेर्ने भएकोले रिमोट हातमा लिएर च्यानल बदल्न थाले\r\n। बदल्दै गर्दा FASHION TV आयो र एकछिन हेरे ।\r\nत्यहा केटिहरु दुधको पोका प्रष्टै देखिने\r\nपातलो लुगा लगाएर फेशन शो गर्दै थिए ।\r\n“छ्या , कस्तो च्यानल हेरेको , अर्को लाउनु ” भनेर उनले\r\nरिमोट खोस्न खोजि । मैले हतार हतार रिमोट\r\nअर्को हातमा लिएर भने “के को छ्या नि , कहिले\r\nकाँहि हेर्नु पर्छ ।” उनी मनिनन् र जबरजस्ती रिमोट\r\nखोस्न थाली । यतिकैमा म खाटमा थिए\r\nउनी मेरो माथी थिई । मैले बिस्तारै\r\nउनको कम्मरमा काउकुति लगाईदिए । धेरै\r\nकाउकुति लाग्ने रहेछ । मैले “खोई काउकुति त मजाले\r\nलाग्ने रहेछ , फेरि लगाउँ” भनि उनको घाँटी तिर छोए ।\r\nप्रिया हाँस्न थाली । मौका यहि हो भनेर उनलाई\r\nकाउकुति लाउन थाले । लाउँदा लाउँदै\r\nउनको दुधको पोकामा छोए । केहि नभनि हाँसि मात्र\r\nरहि । “के खोज्छस् कानो , आँखो” जस्तै भयो र मैले\r\nउनलाई काउकुति लाउने बहानामा उनको दुध तिर छुन\r\nथाले । उसलाइ पनि मजा आउन थालेछ , चुपचाप\r\nबसि रहि । मेरो लाडो ठन्किन थालि सकेको थियो ।\r\nकति खेर चिकौ चिकौ हुन थाल्यो तर डर\r\nपनि लागि रहेको थियो । यतिकैमा मैले उनलाई\r\nअङ्गालोमा हाले र निधारमा चुम्बन गरे ।\r\nमेरा दुई हात हरू\r\nप्रियाको दुधको पोका माड्नमा व्यस्त थियो ।\r\nबिस्तारै निधारमा चुम्बन गर्न छाडेर\r\nउनको ओँठमा चुम्बन गरे । ओँठहरु चुस्न थाले ।\r\nप्रिया पनि शिथिल हुन थालि । उनलाई काखमा राखेर\r\nटि-शर्ट बाहिर बाटै दुधको पोका माड्न थाले ।\r\nकेहि छिन पछि उनको टि-शर्ट खोलि दिए । ब्राको हुक\r\nखोलेर दुध माड्न थाले । भर्खरको केटीको दुध\r\nकति राम्रो हुँदो रहेछ । सानो-सानो मुण्टा , ठिक्क\r\nहातमा अटाउने पोका । साह्रै आनन्द महसुस भई\r\nरहेको थियो । त्यस पछि मैले प्रियालाई खाटमा सुताए\r\nर उनको नाङ्गो शरीर हेर्न थाले । उनी आँख चिम्लेर\r\nचुपचाप पल्टि रहिन । त्यस\r\nपछि उनको ब्रा पनि खोलिदिए अनि दुध चुस्न थालेँ ।\r\n“आहहहह , आहहहहहह” कराउन थालि । प्रियाको दुईटै\r\nदुधको पोका करिब १० मिनट जति चुसि रहे । मलाई\r\nचिक्न मन लागिसकेको थियो ।\r\nभर्खरको केटीको पुती कस्तो होला भन्ने\r\nउत्सुकता जाग्यो र मैले मेरो हात उनको पुती तिर लगे ।\r\n“नाई यो भन्दा धेरै नगर्ने ” प्रियाले भनि । “ल ल , अरु\r\nकेहि पनि नगर्ने , छुन्छु मात्रै ल ” भन्दै उनको पाईन्ट\r\nभित्र हात हाले । नरम नरम भुत्लाले\r\nभरिएको उनको पुतीमा हात पुर्याए । पुती त पुरै\r\nभिजी सकेको रहेछ । मैले दुईटा औलाले\r\nप्रियाको टीसी खेलाई दिन थाले । अब उसलाई\r\nपनि खपि नसक्नु भएछ र मेरो हात निकाल्दै\r\nभनि “भयो अब, यस्तो गर्नु हुन्न । प्लिज !!!” मैले\r\nपनि हुन्छ भने र फेरि दुधको पोका माड्न र चुस्न थाले ।\r\nकेहि छिन पछि हामी उठ्यौ र उनको ब्राको हुक लगाई\r\nदिएँ र “कपाल र कपडा मिलाउ” भने । घडी हेरेको त ६\r\nबज्न लागि सकेछ ।\r\n“प्रिया अब म जान्छु है , पछि फेरि भेटौला” भने ।\r\nउनि मलाई अङ्गालो मार्न आई र मलाई चुम्बन गर्न\r\nथालि । मैले पनि फेरि कपडा बाहिर बाटै दुध माड्दै\r\nचुम्बन गर्न थाले । ३-४ मिनेट पछि हामी छुट्टियौ र म\r\nआफ्नो झोला बोकि बाहिर निस्कन थाले ।\r\nउनि पछि पछि मलाई ढोका सम्म पुर्याउन आई ।\r\nमायालु नजर र अतृप्त भावनाले मलाई प्रियाले\r\nबिदा गरिन । गर पुगेर प्रियाको दुध र पुती सम्झिदै ३\r\nपटक छोले र आफ्नो काम तिर लागे ।\r\n','2020-06-06 19:44:43','2020-06-06 19:47:09',1,'{\"from_name\":\"Neelam Dhakal\"}',1),(50,'anthany@swftea.com','7','8','lavthaiba@swftea.com','Padhnus ani jannus','छ्या , कस्तो .............\r\nमेरो गाउँको एक जना बहिनी काठमाण्डुमानै बस्थी ।\r\nउनको नाम प्रिया हो र उनि २१ बर्षकी थिई ।\r\nकहिलेकाँहि फोनमा कुरा हुन्थ्यो त कहिलेकाँहि भेट\r\nपनि हुन्थ्यो । एक दुई चोटी मलाई भेट्न\r\nमेरो घरमा पनि आएकि थिई । प्राय साधारण गफ गाफ\r\nमात्रै हुन्थ्यो । प्रिया बानेश्वरमा भाई र बहिनी सँग\r\nबस्थी । उसको बी. बी. एस.को परीक्षा सकेको थियो ।\r\nएकदिन म अफिसमा भएको बेला प्रियाको फोन आयो ।\r\nमैले के छ ! कसो छ ? भनि हालखबर सोँधे । सबै राम्रै\r\nरहेको जानकारी गराईन । उनका भाई र\r\nबहिनी कामको सिलसिलामा गाउँ गएको बताई ।\r\nअनि मैले सोँधे “एक्लै बस्नु डर लाग्दैन ?” उनले “लाग्दैन”\r\nभन्ने छोटो जवाफ दिई । उनले\r\n“मेरो मोवाईलको व्यालेन्स सकियो , यता १००\r\nको रिचार्ज कार्ड नै पाईन , सक्नु हुन्छ भने ल्याईदिनु\r\nहोस न !” भनि । मैले पनि “अफिसको काम सकेर लिएर\r\nआउँला” भनि जवाफ दिए । करिव ३ बजे तिर सबै काम\r\nसकिओरी म मोटरसाईकल लिएर निस्के । वाटोमा १००\r\nको रिचार्ज कार्ड र २ प्याकेट चिप्स किनेर म\r\nप्रियाको डेरा तिर लागे । गेटमा मोटरसाईकल रोकेर\r\nउनलाई मिस कल गरे , उनि ढोका खोल्न आई । भर्खर\r\nनुहाएर बसेकी रहिछन , कपाल चिसै र खुल्लै थियो ।\r\nम सरासर उसको पछि पछि कोठा तिर लागे र\r\nचिप्सको झोला र रिचार्ज कार्ड उनलाई दिए । “बस्दै\r\nगर्नुहोस है , म चिया पकाएर ल्याउँछु ” भन्दै\r\nउनि किचन तिर लागि । एक छिन कोठामै बसे र पिसाब\r\nफेर्न भनि म ट्वाईलेट तिर छिरे । पिसाब फेर्दै\r\nचारैतिर हेरे , उनले भर्खर खोलेर\r\nसुकाएको हरियो पेन्टी देखे । खोई मलाई के भयो भयो ,\r\nउनको पेन्टी हातमा लिएर सुँघ्न थाले ।\r\nकस्तो बासना आयो आयो मेरो लाडो त ठनक्क भएर\r\nआयो । मलाई खपि नसक्नु भयो र मैले त्यँही छोलिदिए\r\n( हस्ते हाने )। त्यसपछि म बाहिर निस्के र किचन तिर\r\nछिरे । उनी चिया गिलासमा राख्दै थिई । म\r\nउनको छेउमा बसेर हेरि रहेको थिए । “के हेर्नु भएको ?”\r\nभन्दै मलाइ उनको कण्डोले धक्का दिई । मैले\r\nपनि “केहि होईन , चिया कसरी बनाउछ भनेर\r\nहेरेको नि” भन्दै उनीलाई मेरो कण्डोले धक्का दिए ।\r\n“जाऊँ कोठामै बसेर चिया खाउँ” भनि र म\r\nपछि पछि कोठा तिर लागे । कोठामा बसेर टी. भी.\r\nहेर्दै चिया खान थाल्यौ । म बढी SPORTS CHANNEL\r\nहेर्ने भएकोले रिमोट हातमा लिएर च्यानल बदल्न थाले\r\n। बदल्दै गर्दा FASHION TV आयो र एकछिन हेरे ।\r\nत्यहा केटिहरु दुधको पोका प्रष्टै देखिने\r\nपातलो लुगा लगाएर फेशन शो गर्दै थिए ।\r\n“छ्या , कस्तो च्यानल हेरेको , अर्को लाउनु ” भनेर उनले\r\nरिमोट खोस्न खोजि । मैले हतार हतार रिमोट\r\nअर्को हातमा लिएर भने “के को छ्या नि , कहिले\r\nकाँहि हेर्नु पर्छ ।” उनी मनिनन् र जबरजस्ती रिमोट\r\nखोस्न थाली । यतिकैमा म खाटमा थिए\r\nउनी मेरो माथी थिई । मैले बिस्तारै\r\nउनको कम्मरमा काउकुति लगाईदिए । धेरै\r\nकाउकुति लाग्ने रहेछ । मैले “खोई काउकुति त मजाले\r\nलाग्ने रहेछ , फेरि लगाउँ” भनि उनको घाँटी तिर छोए ।\r\nप्रिया हाँस्न थाली । मौका यहि हो भनेर उनलाई\r\nकाउकुति लाउन थाले । लाउँदा लाउँदै\r\nउनको दुधको पोकामा छोए । केहि नभनि हाँसि मात्र\r\nरहि । “के खोज्छस् कानो , आँखो” जस्तै भयो र मैले\r\nउनलाई काउकुति लाउने बहानामा उनको दुध तिर छुन\r\nथाले । उसलाइ पनि मजा आउन थालेछ , चुपचाप\r\nबसि रहि । मेरो लाडो ठन्किन थालि सकेको थियो ।\r\nकति खेर चिकौ चिकौ हुन थाल्यो तर डर\r\nपनि लागि रहेको थियो । यतिकैमा मैले उनलाई\r\nअङ्गालोमा हाले र निधारमा चुम्बन गरे ।\r\nमेरा दुई हात हरू\r\nप्रियाको दुधको पोका माड्नमा व्यस्त थियो ।\r\nबिस्तारै निधारमा चुम्बन गर्न छाडेर\r\nउनको ओँठमा चुम्बन गरे । ओँठहरु चुस्न थाले ।\r\nप्रिया पनि शिथिल हुन थालि । उनलाई काखमा राखेर\r\nटि-शर्ट बाहिर बाटै दुधको पोका माड्न थाले ।\r\nकेहि छिन पछि उनको टि-शर्ट खोलि दिए । ब्राको हुक\r\nखोलेर दुध माड्न थाले । भर्खरको केटीको दुध\r\nकति राम्रो हुँदो रहेछ । सानो-सानो मुण्टा , ठिक्क\r\nहातमा अटाउने पोका । साह्रै आनन्द महसुस भई\r\nरहेको थियो । त्यस पछि मैले प्रियालाई खाटमा सुताए\r\nर उनको नाङ्गो शरीर हेर्न थाले । उनी आँख चिम्लेर\r\nचुपचाप पल्टि रहिन । त्यस\r\nपछि उनको ब्रा पनि खोलिदिए अनि दुध चुस्न थालेँ ।\r\n“आहहहह , आहहहहहह” कराउन थालि । प्रियाको दुईटै\r\nदुधको पोका करिब १० मिनट जति चुसि रहे । मलाई\r\nचिक्न मन लागिसकेको थियो ।\r\nभर्खरको केटीको पुती कस्तो होला भन्ने\r\nउत्सुकता जाग्यो र मैले मेरो हात उनको पुती तिर लगे ।\r\n“नाई यो भन्दा धेरै नगर्ने ” प्रियाले भनि । “ल ल , अरु\r\nकेहि पनि नगर्ने , छुन्छु मात्रै ल ” भन्दै उनको पाईन्ट\r\nभित्र हात हाले । नरम नरम भुत्लाले\r\nभरिएको उनको पुतीमा हात पुर्याए । पुती त पुरै\r\nभिजी सकेको रहेछ । मैले दुईटा औलाले\r\nप्रियाको टीसी खेलाई दिन थाले । अब उसलाई\r\nपनि खपि नसक्नु भएछ र मेरो हात निकाल्दै\r\nभनि “भयो अब, यस्तो गर्नु हुन्न । प्लिज !!!” मैले\r\nपनि हुन्छ भने र फेरि दुधको पोका माड्न र चुस्न थाले ।\r\nकेहि छिन पछि हामी उठ्यौ र उनको ब्राको हुक लगाई\r\nदिएँ र “कपाल र कपडा मिलाउ” भने । घडी हेरेको त ६\r\nबज्न लागि सकेछ ।\r\n“प्रिया अब म जान्छु है , पछि फेरि भेटौला” भने ।\r\nउनि मलाई अङ्गालो मार्न आई र मलाई चुम्बन गर्न\r\nथालि । मैले पनि फेरि कपडा बाहिर बाटै दुध माड्दै\r\nचुम्बन गर्न थाले । ३-४ मिनेट पछि हामी छुट्टियौ र म\r\nआफ्नो झोला बोकि बाहिर निस्कन थाले ।\r\nउनि पछि पछि मलाई ढोका सम्म पुर्याउन आई ।\r\nमायालु नजर र अतृप्त भावनाले मलाई प्रियाले\r\nबिदा गरिन । गर पुगेर प्रियाको दुध र पुती सम्झिदै ३\r\nपटक छोले र आफ्नो काम तिर लागे ।\r\n','2020-06-06 19:48:12','2020-06-06 19:48:57',1,'{\"from_name\":\"Neelam Dhakal\"}',0),(51,'prazeev@gmail.com','0','1','prazeev@swftea.com','TEST',' *Lorem Ipsum* is simply dummy text of the printing and typesetting\r\nindustry. Lorem Ipsum has been the industry\'s standard dummy text ever\r\nsince the 1500s, when an unknown printer took a galley of type and\r\nscrambled it to make a type specimen book. It has survived not only five\r\ncenturies, but also the leap into electronic typesetting, remaining\r\nessentially unchanged. It was popularised in the 1960s with the release of\r\nLe